import React from "react";
import Header from "./Header"
import Footer from "./Footer"
import Note from "./Note"
import Notes from "../Notes"

function App() {
    return (
    <div>
        <Header />
        {Notes.Map((newnote) =>
        <Note
        key= {newnote.key}
        titles= {newnote.title}
        contents = {newnote.content}
        />
    )};

        <Footer />
    </div>
        
    )
}
export default App;
